import React from "react";
import logo from "../images/2d1da0e5243b1cda8bd04a7e9823a88d.png";

const Section = () => {
  return (
    <section id="section">
      <div className="container">
        <div className="section">
          <img src={logo} alt="" />
        </div>
      </div>
    </section>
  );
};

export default Section;
